function generateVersion(bForce) {
	let version //= localStorage.getItem("TTS_Version");
	if (bForce || !version) {
		version = [...Array(4)]
			.map(() => Math.floor(Math.random() * 9).toString(10))
			.join('');
		// localStorage.setItem("TTS_Version", version);
	}
	console.log("Version: ", version);
	return version;
}

